query{
    characters{
        results{
            id
            name
            image
        }
    }
}
`

export default function CharactersList() {
    const {error, data, loading} = useQuery(GET_CHARACTERS);
    console.log({error, loading, data});
    return (
        <div>CharactersList</div>
    )
}
